import{_ as A}from"./plugin-vue_export-helper-c27b6911.js";import{o as I,c as E,f as e}from"./app-79a82278.js";const r={},v=e(`<h2 id="rdb" tabindex="-1"><a class="header-anchor" href="#rdb" aria-hidden="true">#</a> RDB</h2><img src="data:image/png;base64,"><p>在指定的时间间隔内将内存中的数据集快照写入磁盘，也就是行话讲Snapshot快照，它恢复时是将快照文件直接读到内存里。</p><p>Redis会单独创建（fork）一个子进程来进行持久化，会先将数据写入到一个临时文件中，待持久化过程都结束了，再用这个临时文件替换上次持久化好的文件。整个过程中，主进程是不进行任何IO操作的。这就确保了极高的性能。如果需要进行大规模数据的恢复，且对于数据恢复的完整性不是非常敏感，那RDB方式要比AOF方式更加的高效。RDB的缺点是最后一次持久化后的数据可能丢失。我们默认的就是RDB，一般情况下不需要修改这个配置！</p><p>rdb保存的文件是dump.rdb。都是在我们的配置文件中快照中进行配置的！</p><img src="data:image/png;base64,"><p>触发机制</p><ol><li>save的规则满足的情况下，会自动触发rdb规则!</li><li>执行flushall 命令，也会触发我们的rdb规则！</li><li>退出redis，也会产生rdb文件！</li></ol><p>​ 备份完成后就会生成一个dump.rdb文件</p><p>如何恢复RDB文件</p><ol><li><p>只需要将rdb文件放在我们redis启动目录就可以，redis启动的时候会自动检查dump.rdb恢复其中的数据！</p></li><li><p>查看rdb文件需要存放的位置</p><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="language-bash"><code>config get <span class="token function">dir</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div></li></ol><p>优点：</p><ol><li>适合大规模的数据恢复！</li><li>要求：对数据的完整性不高！</li></ol><p>缺点：</p><ol><li>需要一定的时间间隔进程操作！如果redis意外宕机了，这个最后一次修改数据就没有了！</li><li>fork进程的时候，会占用一定的内存空间！</li></ol><h2 id="aof" tabindex="-1"><a class="header-anchor" href="#aof" aria-hidden="true">#</a> AOF</h2><img src="data:image/png;base64,"><p>默认是不开启的，我们需要手动进行配置！我们只需要将appendonly改为yes就开启了aof！</p><p>重启，redis 就可以生效了！</p><p>如果这个aof文件有错误，这时候redis 是启动不起来的吗，我们需要修复这个aof文件redis 给我们提供了一个修复工具</p><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="language-bash"><code>redis-check-aof - <span class="token parameter variable">-fix</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>如果文件正常，重启就可以直接恢复了！</p><p>重写规则说明：</p><p>aof默认就是文件的无限追加，文件会越来越大！</p><img src="data:image/png;base64,"><p>如果aof文件大于64mb，太大了！fork一个新的进程来将我们的文件进行重写！</p><p>默认是不开启aof模式的，默认是使用rdb模式持久化。大部分情况下，rdb完全够用</p><p>优点和缺点：</p><div class="language-bash line-numbers-mode" data-ext="sh"><pre class="language-bash"><code>appendfsync always <span class="token comment"># 每次修改都会sync，消耗性能。</span>
appendfsync everysec <span class="token comment"># 每秒执行一次sync，可能会丢失这一秒数据。</span>
appendfsync no     <span class="token comment"># 不执行，这个时候操作系统自己同步数据，速度最快</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>优点：</p><ul><li><p>每一次修改都同步，文件的完整会更加好！</p></li><li><p>每秒同步一次，可能会丢失一秒的数据</p></li><li><p>从不同步，效率最高的！</p></li></ul><p>缺点：</p><ul><li><p>相对于数据文件来说，aof远远大于rdb，修复的速度也比rdb慢！</p></li><li><p>Aof运行效率也要比rdb慢，所以我们redis默认的配置就是rdb持久化！</p></li></ul><h2 id="扩展" tabindex="-1"><a class="header-anchor" href="#扩展" aria-hidden="true">#</a> 扩展</h2><ol><li><p>RDB持久化方式能够在指定的时间间隔内对你的数据进行快照存储</p></li><li><p>AOF持久化方式记录每次对服务器写的操作，当服务器重启的时候会重新执行这些命令来恢复原始的数据，AOF命令以Redis协议追加保存每次写的操作到文件末尾，Redis还能对AOF文件进行后台重写，使得AOF文件的体积不至于过大。</p></li><li><p>只做缓存，如果你只希望你的数据在服务器运行的时候存在，你也可以不使用任何持久化。</p></li><li><p>同时开启两种持久化方式</p><ul><li>在这种情况下，当redis重启的时候会优先载入AOF文件来恢复原始的数据，因为在通常情况下AOF文件保存的数据集要比RDB文件保存的数据集要完整。</li><li>RDB的数据不实时，同时使用两者时服务器重启也只会找AOF文件，那要不要只使用AOF呢？作者建议不要，因为RDB更适合用于备份数据库（AOF在不断变化不好备份），快速重启，而且不会有AOF可能潜在的Bug，留着作为一个万一的手段。</li></ul></li><li><p>性能建议</p><ul><li>因为RDB文件只用作后备用途，建议只在Slave上持久化RDB文件，而且只要15分钟备份一次就够了，只保留save 900 1这条规则。</li><li>如果Enable AOF，好处是在最恶劣情况下也只会丢失不超过两秒数据，启动脚本较简单只load自己的AOF文件就可以了，代价一是带来了持续的I0，二是AOF rewrite的最后将 rewrite过程中产生的新数据写到新文件造成的阻塞几乎是不可避免的。只要硬盘许可，应该尽量减少AOF rewrite的频率，AOF重写的基础大小默认值64M太小了，可以设到5G以上，默认超过原大小100%大小重写可以改到适当的数值。</li><li>如果不Enable AOF，仅靠Master-Slave Replcation实现高可用性也可以，能省掉一大笔lO，也减少了rewrite时带来的系统波动。代价是如果Master/Slave 同时倒掉，会丢失十几分钟的数据，启动脚本也要比较两个Master/Slave中的RDB文件，载入较新的那个，微博就是这种架构。</li></ul></li></ol>`,35),i=[v];function z(n,s){return I(),E("div",null,i)}const B=A(r,[["render",z],["__file","Redis持久化.html.vue"]]);export{B as default};
